const initialState = {
    assignmentList:[]
}
export default (state=initialState,action) =>
{
    switch(action.type)
    {
        case "UPDATE_DATA":{
            return {
                ...state,
                taskList:action.payload,
            };
        }
        default:
            return {...state}  
    }
}
